  CONSTRAINT `FK_solicitudes_estudiantes_solicitudes` FOREIGN KEY (`solicitudes_detalles_id2`) REFERENCES `solicitudes_detalles` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

